import React, { Component } from 'react';
import reactDom from 'react-dom';
import BGimg from './assets/attract.jpg';


class Background extends Component {
    state = {
        imageUrl : "url($(BGimg))"
    };
    
    
    render() { 
        return ( 
            <div >      
                <img src={this.state.imageUrl}></img>  
                hello
            </div>
         );
    }
}
 
export default Background;
